import React from "react";
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';

const Note = (props) => {

    const deleteNote = () => {

        props.deleteItem(props.id);
    }
    
    return (

        <>
            <div className="note">

                <h1>{props.title}</h1>
                <h1>{props.first}</h1>
                <h1>{props.last}</h1>
                <br />

                <p>{props.content}</p>

                <button className="btn" onClick={deleteNote}>

                    <DeleteOutlineIcon className="deleteIcon" />

                </button>
            </div>
        </>

    )

}

export default Note;
